body:
This will remove the shapes from graph outputs and subgraph inputs. After updating it runs shape inference and checks the model. 

I would recommend saving the model without the inferred shapes as it's smaller and they can obviously be inferred at runtime. Doesn't matter if you save the model with that info though.

```python
import onnx

def remove_shape(value):
  if value.type.HasField("tensor_type"):
    shape = value.type.tensor_type.shape
    if shape:
      value.type.tensor_type.ClearField('shape')


def update_graph(graph, level=0):
  # subgraph input shapes can be inferred so those can be removed if level > 0
  if level > 0:
    for input in graph.input:
      remove_shape(input)

  for output in graph.output:
    remove_shape(output)

  for node in graph.node:
    for attr in node.attribute:
      if attr.HasField('g'):
        update_graph(attr.g, level + 1)


model_path = "model_ch.onnx"
model = onnx.load_model(model_path)

update_graph(model.graph)

# check model
model_with_shape_info = onnx.shape_inference.infer_shapes(model)
onnx.checker.check_model(model_with_shape_info, True)
```
